import random

def tree_generator(cbranches = None, cleaves = None, max_depth=3, current_depth=0):
    """
    Генерирует дерево с произвольным количеством веток и листьев.

    Параметры:
    - cbranches (int, optional): Количество веток на верхнем уровне. 
      Если не задано, будет сгенерировано случайное значение от 1 до 3.
    - cleaves (int, optional): Количество листьев на каждой ветке. 
      Если не задано, будет сгенерировано случайное значение от 1 до 3.
    - max_depth (int): Максимальная глубина дерева. По умолчанию 3.
    - current_depth (int): Текущая глубина рекурсии. Используется внутренне. По умолчанию 0.

    Возвращает:
    - list: Сгенерированное дерево в виде вложенного списка. Листья представлены строкой 'leaf'.

    Примеры использования:
    >>> tree = tree_generator(2, 3)
    >>> print(tree)
    [[['leaf', 'leaf', 'leaf'], ['leaf']]]

    >>> tree = tree_generator()
    >>> print(tree)
    [['leaf', 'leaf', 'leaf']]
    """
    if not cbranches:
        cbranches = random.randint(1, 3)
    if not cleaves:
        cleaves = random.randint(1, 3)
    branches = []
    for _ in range(cbranches):
        if random.choice([True, False]) and current_depth < max_depth:
            branches.append(tree_generator(random.randint(1, 3), random.randint(1, 3)))
        else:
            for _ in range(cleaves):
                branches.append('leaf')
    return branches
    
    
